	[character]
	_addr="0xa5d86d0"
	current_frame="normal"
	custom="yes"
	face_right="no"
	label="_3cea777a"
	
	on_process="[
		if(self.tmp.goLock, set(velocity_x, -250))
	]"
	
	on_talk="[swallow_event(), speech_dialog(
			self, 				if(not self.tmp.knows, 
									[~Yous the repair guy?~],
									[~Keep moving.~]
								) + 
			
			if (
				not self.tmp.knows, [
					~Yes.~, [
						speech_dialog(
							level.player, 		set(level.player.animation, 'emote_talk'),
												[~What seems to be the problem?~],
												
							self,				[~Dumbwaiter's broken.~, ~It's stuck half-way down the shaft.~],
							
							level.player, 		set(level.player.animation, 'emote_talk'),
												[~Sounds trickey.~, ~I'd better go take a look at it.~],
												
							self,				[~Where's your tools, anyway?~],
							
							level.player, 		set(level.player.animation, 'emote_talk'),
												[~I can't climb with tools. Too heavy.~],
												
							self,				[~Hmh. Guess not.~]
						),
						set (self.tmp.knows, 1)
					]
				] 
			) + 
					
				if (
					not self.tmp.knows, [
						~No.~, [
							speech_dialog(
								level.player, 		set(level.player.animation, 'emote_talk'),
													[~I'm here to visit Milgram.~],
													set(level.player.animation, 'emote_confused'),
													[~But I'm a little lost.~, ~Do you know where he is?~],
													
								self,				[~How should I know? I'm just a chef,~, ~not his darned valet.~, ~... How'd you get in here?~],
								
								level.player, 		set(level.player.animation, 'emote_talk'),
													[~The door was unlocked.~],
													
								self,				[~Darn guards! They never lock up~, ~after themselves!~]
							),
							set (self.tmp.goLock, 1),
							set (self.tmp.knows, 1)
						]
					]
				) +
				
				if (
					not self.tmp.iAm, [
						~You are?~, [
							speech_dialog(
								self,				[~Sorry. I'm Gritus. I'm the chef~, ~and manager of Sky Milgram.~],
							),
							set (self.tmp.iAm, 1)
						]
					],
					[]
				) +
				
				if (
					self.tmp.knows and (not self.tmp.iAm), [
						~Bye.~, [
							speech_dialog(
								level.player, 		set(level.player.animation, 'emote_raisedfinger'),
													[~Uh, never mind.~, ~I just remembered.~]
							)
						]
					]
				)
					

		)]"
		
